    <ItemList/>

  

    
     <AppButton title="Add Coin" color="accent" onPress={() => console.log("Tapped")}/>
      
    
    </View>

    </View>
  </SafeAreaView>


  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    paddingTop: Platform.OS === "android"? StatusBar.currentHeight : 0, //If its android, set it to 20 otherwise 0
